// Problem: https://www.hackerrank.com/challenges/maxsubarray/problem
// References: https://en.wikipedia.org/wiki/Maximum_subarray_problem

function getMaximumSubSequence(arr) {
    const dp = [];
    dp[0] = parseInt(arr[0]);
    for (let i = 1; i < arr.length; i++) {
        arr[i] = parseInt(arr[i]);
        dp[i] = Math.max(dp[i - 1], arr[i], dp[i - 1] + arr[i]);
    }

    return dp[arr.length - 1];
}

function getMaximumSubArr(arr) {
    let dp = 0;
    let max = Math.max(...arr);
    for (let i = 0; i < arr.length; i++) {
        if (max > 0) {
            dp = Math.max(0, dp + parseInt(arr[i]));
        } else {
            // -Math.pow(10, 4) is minimum value
            dp = Math.max(-Math.pow(10, 4), dp + parseInt(arr[i]));
        }
        max = Math.max(dp, max);
    }

    return max;
}

